import { Fragment } from "react";
import "./Header.module.css";
import img from '../../assets/R.jpg'


const Header = props => {

    return <Fragment>
        <header className={classes.header}>
            <h1>ReactMeals</h1>
            <button>Cart</button>
        </header>
        <div className={classes['main-image']}>
            <img src={img} alt="Food" />
        </div>
    </Fragment>

};

export default Header;
